svg.script:
trackClasses = [];
i = 1;
for (; i < 12; i++) {
	trackClasses.push('track' + i);
}
this.onload = function() {
	buttons = document.querySelectorAll('.track-selection > g');
	reverseButton = buttons[0];
	isReverse = reverseButton.classList.contains('active');
	showHideTrajectories();
	buttons.forEach(function(button){
		if (button == reverseButton) {
			button.addEventListener('click', function(){ 
				button.classList.toggle('active');
				isReverse = reverseButton.classList.contains('active');
				showHideTrajectories();
			});			
		} else {
			button.addEventListener('click', function(){ 
				changeTrajectories(button);
			});			
		}
	});
}

function showHideTrajectories() {
	document.documentElement.classList[!isReverse ? 'add' : 'remove']('forward');
	document.documentElement.classList[isReverse ? 'add' : 'remove']('reverse');
}

function changeTrajectories(activeButton) {
	document.documentElement.classList.remove.apply(document.documentElement.classList, trackClasses)
	buttons.forEach(function(button){
		if (button != reverseButton && button != activeButton) {
			button.classList.remove('active');
		} else if (button == activeButton) {
			button.classList.add('active');
		}
	});
	document.documentElement.classList.add('track' + activeButton.querySelector('text').textContent);
}
